                        <th>Description</th>
                    </tr>
                    {ldItems?.items?.filter((item) => item.tags.some((tag) => ['Saigon_Squad', 'Saigon'].includes(tag))).map((item) =>
                        <tr>
                            <td>{item.key}</td>
                            <td>
                                <input type="checkbox" name={item.key} id={item.key} checked={item.environments['sit-1'].on} onChange={()=>{}} />
                            </td>
                            <td>{item.description}</td>
                        </tr>
                    )}
